rds_zbb::rds_zbb(TTree *tree) : fChain(0) 
{
// if parameter tree is not specified (or zero), connect the file
// used to generate this class and read the Tree.
   if (tree == 0) {
      TFile *f = (TFile*)gROOT->GetListOfFiles()->FindObject("/nfs/user/cbeluffi/ControlPlots/RDS_RDS_JP_V1/ZZ_Summer12_final.root");
      if (!f || !f->IsOpen()) {
         f = new TFile("/nfs/user/cbeluffi/ControlPlots/RDS_RDS_JP_V1/ZZ_Summer12_final.root");
      }
      f->GetObject("rds_zbb",tree);

   }
   Init(tree);
}

rds_zbb::~rds_zbb()
{
   if (!fChain) return;
   delete fChain->GetCurrentFile();
}

Int_t rds_zbb::GetEntry(Long64_t entry)
{
// Read contents of entry.
   if (!fChain) return 0;
   return fChain->GetEntry(entry);
}
Long64_t rds_zbb::LoadTree(Long64_t entry)
{
// Set the environment to read one entry
   if (!fChain) return -5;
   Long64_t centry = fChain->LoadTree(entry);
   if (centry < 0) return centry;
   if (fChain->GetTreeNumber() != fCurrent) {
      fCurrent = fChain->GetTreeNumber();
      Notify();
   }
   return centry;
}

